import { Button } from "@chakra-ui/react";
import pdfMake from "pdfmake/build/pdfmake";
import Step from "../models/Steps";
import pdfFonts from "pdfmake/build/vfs_fonts";
import Process from "../models/Process";
import { Content } from "pdfmake/interfaces";
import { isValid } from "date-fns";
import { getAllByTitle } from "@testing-library/react";


// Carregando os plugins de fonte para o PDFmake
(pdfMake as any).vfs = pdfFonts.pdfMake.vfs;

interface PDFProcessInterface {
    process: Process;
    userName?: string;
}

export const BtnExpPDF = ({process, userName }: PDFProcessInterface) => {
    const handleExportPDF = () => {
        
        // Criando o PDF com o conteudo do processo selecionado
        var docDefinition = {
            pageSize: 'A4',
            pageMargins: [ 50, 40, 50, 0 ],
            content: [
                {
                    columns: [
                        {
                            image: 'data:image/png;base64,',
                            width: 170,
                            height: 90,
                        },
                        {
                            text:  [{text:'\n Gerente: ', fontSize:12, bold:true},` ${userName} \n`,
                                    {text:'Data: ', fontSize:12, bold:true},` ${process.createDate} \n`,
                                    {text:'Prazo: ', fontSize:12, bold:true},` ${process.endingDate} \n`,]
                        }
                    ],
                    //Espaçamento entre colunas
                    columnGap: 200
                },
                {
                    text: '\n\nRelatório de Processo', fontSize: 24,
                    alignment: 'center'
                },
                {
                    text:  [{text:'\n Nome do processo: ', fontSize:12, bold:true},`\n`,
                            {text:` ${process.title} \n`}]
                },
                {
                    text:  [{text:'\n Descrição: ', fontSize:12, bold:true},`\n`,
                            {text:` ${process.description} \n`}]
                },
                {
                    text:  [{text:'\n Objetivo: ', fontSize:12, bold:true},`\n`,
                            {text:` ${process.objective} \n`}]
                },
                {
                    text:  [{text:'\n Etapas: ', fontSize:12, bold:true},`\n`,
                            {text:'Concluidas: ', fontSize:12},` ${process.stepsConcluidas} \n`,
                            {text:'Pendentes: ', fontSize:12},` ${process.stepsNaoIniciadas + process.stepsIniciadas} \n`,
                            {text:'Total: ', fontSize:12},` ${process.stepsLength} \n`,]
                },
            ],

        } as { content: Content; styles?: Record<string, any> };

        // Gerando o PDF e abre no navegador
        pdfMake.createPdf(docDefinition).open(); 
        // Recarrega a Página para atualizar os Getter que utiliza para exibir os stepsConcluidas e StepsNaoIniciadas
        window.location.reload();
    };

    return (
        <>
            <Button
                bg='#53C4CD'
                variant='solid'
                textColor='white'
                colorScheme="#58595B"
                width={['auto', '8rem']}
                onClick={handleExportPDF}
            >
                Exportar PDF
            </Button>
        </>
    );
};